import React, { Component } from 'react'

const NewsReel = (props) => {
    const listArticles = () => {
        return props.articles.map(article => {
            return <div>{article.title}</div>
        })
    }

    return <div>
        {listArticles()}
    </div>
}

export default NewsReel
